import React from 'react';
import {
  View,
  Text,
  StyleSheet,
  ScrollView,
  TouchableOpacity,
  Image,
  Share,
} from 'react-native';
import { Icon } from '@rneui/themed';
import { useSelector } from 'react-redux';

const BookingConfirmationScreen = ({ navigation, route }) => {
  const { booking } = route.params;
  const { user } = useSelector((state) => state.auth);

  // Generate a random booking reference number
  const bookingReference = `BK${Math.floor(100000 + Math.random() * 900000)}`;

  const handleShare = async () => {
    try {
      await Share.share({
        message: `I've just booked a stay at ${booking.hotelName}! Check-in: ${booking.checkIn}, Check-out: ${booking.checkOut}. Booking reference: ${bookingReference}`,
        title: 'My Hotel Booking',
      });
    } catch (error) {
      console.error('Error sharing booking:', error);
    }
  };

  const handleViewBookings = () => {
    navigation.navigate('Bookings');
  };

  const handleBackToHome = () => {
    navigation.navigate('HomeScreen');
  };

  return (
    <ScrollView style={styles.container} showsVerticalScrollIndicator={false}>
      <View style={styles.header}>
        <View style={styles.successIconContainer}>
          <Icon name="checkmark-circle" type="ionicon" size={80} color="#4CAF50" />
        </View>
        <Text style={styles.successTitle}>Booking Confirmed!</Text>
        <Text style={styles.successMessage}>
          Your booking has been successfully confirmed. We've sent the details to your email.
        </Text>
      </View>

      <View style={styles.card}>
        <View style={styles.cardHeader}>
          <Text style={styles.cardTitle}>Booking Details</Text>
          <Text style={styles.bookingReference}>Ref: {bookingReference}</Text>
        </View>

        <View style={styles.hotelInfo}>
          <Text style={styles.hotelName}>{booking.hotelName}</Text>
          <Text style={styles.roomType}>{booking.roomType} Room</Text>
        </View>

        <View style={styles.divider} />

        <View style={styles.detailsContainer}>
          <View style={styles.detailItem}>
            <Text style={styles.detailLabel}>Check-in</Text>
            <Text style={styles.detailValue}>{booking.checkIn}</Text>
          </View>
          <View style={styles.detailItem}>
            <Text style={styles.detailLabel}>Check-out</Text>
            <Text style={styles.detailValue}>{booking.checkOut}</Text>
          </View>
          <View style={styles.detailItem}>
            <Text style={styles.detailLabel}>Guests</Text>
            <Text style={styles.detailValue}>{booking.guests}</Text>
          </View>
          <View style={styles.detailItem}>
            <Text style={styles.detailLabel}>Total Price</Text>
            <Text style={styles.detailValue}>${booking.totalPrice}</Text>
          </View>
        </View>

        {booking.specialRequests && (
          <>
            <View style={styles.divider} />
            <View style={styles.specialRequestsContainer}>
              <Text style={styles.specialRequestsLabel}>Special Requests:</Text>
              <Text style={styles.specialRequestsText}>{booking.specialRequests}</Text>
            </View>
          </>
        )}
      </View>

      <View style={styles.card}>
        <View style={styles.cardHeader}>
          <Text style={styles.cardTitle}>Contact Information</Text>
        </View>

        <View style={styles.detailsContainer}>
          <View style={styles.detailItem}>
            <Text style={styles.detailLabel}>Name</Text>
            <Text style={styles.detailValue}>{booking.contactName}</Text>
          </View>
          <View style={styles.detailItem}>
            <Text style={styles.detailLabel}>Email</Text>
            <Text style={styles.detailValue}>{booking.contactEmail}</Text>
          </View>
          <View style={styles.detailItem}>
            <Text style={styles.detailLabel}>Phone</Text>
            <Text style={styles.detailValue}>{booking.contactPhone}</Text>
          </View>
        </View>
      </View>

      <View style={styles.card}>
        <View style={styles.cardHeader}>
          <Text style={styles.cardTitle}>Payment Information</Text>
        </View>

        <View style={styles.detailsContainer}>
          <View style={styles.detailItem}>
            <Text style={styles.detailLabel}>Payment Method</Text>
            <Text style={styles.detailValue}>Credit Card (•••• 1234)</Text>
          </View>
          <View style={styles.detailItem}>
            <Text style={styles.detailLabel}>Status</Text>
            <View style={styles.statusContainer}>
              <View style={styles.statusDot} />
              <Text style={styles.statusText}>Paid</Text>
            </View>
          </View>
        </View>
      </View>

      <View style={styles.actionsContainer}>
        <TouchableOpacity style={styles.shareButton} onPress={handleShare}>
          <Icon name="share-social" type="ionicon" size={20} color="#FFFFFF" />
          <Text style={styles.shareButtonText}>Share</Text>
        </TouchableOpacity>

        <TouchableOpacity style={styles.viewBookingsButton} onPress={handleViewBookings}>
          <Text style={styles.viewBookingsText}>View My Bookings</Text>
        </TouchableOpacity>

        <TouchableOpacity style={styles.homeButton} onPress={handleBackToHome}>
          <Text style={styles.homeButtonText}>Back to Home</Text>
        </TouchableOpacity>
      </View>

      <View style={styles.supportContainer}>
        <Text style={styles.supportText}>Need help with your booking?</Text>
        <TouchableOpacity style={styles.supportButton}>
          <Icon name="chatbubble-ellipses" type="ionicon" size={16} color="#007BFF" />
          <Text style={styles.supportButtonText}>Contact Support</Text>
        </TouchableOpacity>
      </View>
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#F8F9FA',
  },
  header: {
    alignItems: 'center',
    padding: 30,
    paddingTop: 60,
    backgroundColor: '#FFFFFF',
  },
  successIconContainer: {
    marginBottom: 20,
  },
  successTitle: {
    fontSize: 24,
    fontWeight: 'bold',
    color: '#333333',
    marginBottom: 10,
  },
  successMessage: {
    fontSize: 16,
    color: '#666666',
    textAlign: 'center',
    lineHeight: 24,
  },
  card: {
    backgroundColor: '#FFFFFF',
    borderRadius: 10,
    marginHorizontal: 20,
    marginTop: 20,
    padding: 20,
    shadowColor: '#000',
    shadowOffset: { width: 0, height: 2 },
    shadowOpacity: 0.1,
    shadowRadius: 4,
    elevation: 2,
  },
  cardHeader: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    marginBottom: 15,
  },
  cardTitle: {
    fontSize: 18,
    fontWeight: 'bold',
    color: '#333333',
  },
  bookingReference: {
    fontSize: 14,
    color: '#007BFF',
    fontWeight: 'bold',
  },
  hotelInfo: {
    marginBottom: 15,
  },
  hotelName: {
    fontSize: 18,
    fontWeight: 'bold',
    color: '#333333',
    marginBottom: 5,
  },
  roomType: {
    fontSize: 16,
    color: '#666666',
  },
  divider: {
    height: 1,
    backgroundColor: '#EEEEEE',
    marginVertical: 15,
  },
  detailsContainer: {
    marginBottom: 5,
  },
  detailItem: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    marginBottom: 12,
  },
  detailLabel: {
    fontSize: 16,
    color: '#666666',
  },
  detailValue: {
    fontSize: 16,
    color: '#333333',
    fontWeight: '500',
  },
  specialRequestsContainer: {
    marginBottom: 5,
  },
  specialRequestsLabel: {
    fontSize: 16,
    color: '#666666',
    marginBottom: 5,
  },
  specialRequestsText: {
    fontSize: 16,
    color: '#333333',
    lineHeight: 22,
  },
  statusContainer: {
    flexDirection: 'row',
    alignItems: 'center',
  },
  statusDot: {
    width: 8,
    height: 8,
    borderRadius: 4,
    backgroundColor: '#4CAF50',
    marginRight: 5,
  },
  statusText: {
    fontSize: 16,
    color: '#4CAF50',
    fontWeight: '500',
  },
  actionsContainer: {
    marginHorizontal: 20,
    marginTop: 30,
    marginBottom: 20,
  },
  shareButton: {
    backgroundColor: '#007BFF',
    flexDirection: 'row',
    justifyContent: 'center',
    alignItems: 'center',
    paddingVertical: 15,
    borderRadius: 8,
    marginBottom: 15,
  },
  shareButtonText: {
    color: '#FFFFFF',
    fontSize: 16,
    fontWeight: 'bold',
    marginLeft: 10,
  },
  viewBookingsButton: {
    backgroundColor: '#F0F0F0',
    paddingVertical: 15,
    borderRadius: 8,
    alignItems: 'center',
    marginBottom: 15,
  },
  viewBookingsText: {
    color: '#333333',
    fontSize: 16,
    fontWeight: 'bold',
  },
  homeButton: {
    paddingVertical: 15,
    borderRadius: 8,
    alignItems: 'center',
    borderWidth: 1,
    borderColor: '#007BFF',
  },
  homeButtonText: {
    color: '#007BFF',
    fontSize: 16,
    fontWeight: 'bold',
  },
  supportContainer: {
    alignItems: 'center',
    marginVertical: 30,
  },
  supportText: {
    fontSize: 14,
    color: '#666666',
    marginBottom: 10,
  },
  supportButton: {
    flexDirection: 'row',
    alignItems: 'center',
  },
  supportButtonText: {
    fontSize: 14,
    color: '#007BFF',
    fontWeight: 'bold',
    marginLeft: 5,
  },
});

export default BookingConfirmationScreen;
